import React, { Component } from 'react';
import martianlogo from './The_Martian_image.jpg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div class="App">
        <img src={martianlogo} alt='The Martian Logo'/>
        <br /><br /><br />
        <div>
          <div>ReactJs</div>
          <div>JavaScript</div>
          <div>HTML</div>
        </div>
      </div>
    );
  }
}

export default App;
